import React, { Component } from 'react';

class Header extends Component {
  state = { button: 'none' };

  activateHome = () => {
    this.setState({ button: 'home' });
  };

  activateAbout = () => {
    this.setState({ button: 'about' });
  };

  activateServices = () => {
    this.setState({ button: 'services' });
  };

  activateContact = () => {
    this.setState({ button: 'contact' });
  };

  render() {
    return (
      <div>
        <h1>Hello</h1>
      </div>
    );
  }
}

export default Header;
